import React from 'react';
import Fab from '@material-ui/core/Fab';
import EditIcon from '@material-ui/icons/Edit';
import TDLS from  "./ToDoLists.module.css"


 const EditToDoListTitleButton =()=> {


    return (
        <div>
            <Fab className={TDLS.editButtonSize} color="secondary" aria-label="edit" >
                <EditIcon />
            </Fab>

        </div>
    );
}
export default EditToDoListTitleButton
